description:
Skeddrag är ett effektivt bete för att fånga fiske med! Skeddragen förekommer i många olika färger och modeller, vi på Eagle Fishing har skeddrag i olika former och storlekar.

Vårt sortiment består av multifärgade, stora, små, vasskyddad m.m. Vi har prylar till dig så att du kan ha en trevlig upplevelse vid ditt nästa fiskepass!

